import { GoogleMap, MarkerF, PolygonF, useJsApiLoader } from '@react-google-maps/api';
import React from 'react';

const containerStyle = {
  width: '100%',
  height: '600px',
};

const center = {
  lat: 23.3441,
  lng: 85.3096,
};

const districtCoords = [
  // Coordinates for each polygon (P1, P2, ... P10)
  [
    { lat: 23.467, lng: 85.268 },
    { lat: 23.464, lng: 85.310 },
    { lat: 23.445, lng: 85.325 },
    { lat: 23.455, lng: 85.275 },
  ],
  [
    { lat: 23.445, lng: 85.325 },
    { lat: 23.445, lng: 85.365 },
    { lat: 23.425, lng: 85.365 },
    { lat: 23.425, lng: 85.325 },
  ],
  [
    { lat: 23.480, lng: 85.300 },
    { lat: 23.475, lng: 85.335 },
    { lat: 23.460, lng: 85.340 },
    { lat: 23.455, lng: 85.300 },
  ],
  // Add more coordinates for other polygons P4, P5, ... P10
];

// Icon positions for each polygon
const iconCoordinates = {
  P1: { lat: 23.467, lng: 85.268 },
  P2: { lat: 23.445, lng: 85.325 },
  P3: { lat: 23.457, lng: 85.310 },
  P4: { lat: 23.475, lng: 85.320 },
  P5: { lat: 23.460, lng: 85.305 },
  P6: { lat: 23.435, lng: 85.350 },
  P7: { lat: 23.485, lng: 85.340 },
  P8: { lat: 23.425, lng: 85.365 },
  P9: { lat: 23.400, lng: 85.310 },
  P10: { lat: 23.475, lng: 85.300 },
};

// URLs for the icons to be used in each polygon
const iconUrls = {
  P1: "URL_TO_ICON_1",
  P2: "URL_TO_ICON_2",
  P3: "URL_TO_ICON_3",
  P4: "URL_TO_ICON_4",
  P5: "URL_TO_ICON_5",
  P6: "URL_TO_ICON_6",
  P7: "URL_TO_ICON_7",
  P8: "URL_TO_ICON_8",
  P9: "URL_TO_ICON_9",
  P10: "URL_TO_ICON_10",
};

const MapComponent = () => {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk",
  });

  return isLoaded ? (
    <GoogleMap mapContainerStyle={containerStyle} center={center} zoom={8}>
      {/* Loop through districtCoords and create Polygons */}
      {districtCoords.map((coords, index) => (
        <PolygonF
          key={index}
          paths={coords}
          options={{
            fillColor: ['#FF0000', '#00FF00', '#0000FF', '#FFFF00', '#FFA500', '#800080', '#008080', '#FFC0CB', '#808080', '#A52A2A'][index],
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
        />
      ))}

      {/* Loop through iconCoordinates and add Icons */}
      {Object.entries(iconCoordinates).map(([key, position]) => (
        <MarkerF
          key={key}
          position={position}
          icon={{
            url: iconUrls[key], // Use the corresponding icon for each polygon
            scaledSize: new window.google.maps.Size(32, 32), // Adjust size
          }}
          label={{
            text: key, // Display P1, P2, etc.
            fontSize: '12px',
            color: 'white',
          }}
        />
      ))}
    </GoogleMap>
  ) : <></>;
};

export default MapComponent;
